import React from "react";
import Header from "./components/Header";
import 'bootstrap/dist/css/bootstrap.min.css';
import Videos from './components/Videos';
import "./App.css";

const App = () => {
  return (
    <div className="App">
     <header className="App-header">
        <h1>Video Recommendation</h1>
      </header>
      
      <Videos />
    </div>
  );
}
export default App;
